import React from 'react';
import { Container } from 'react-bootstrap';
// import './Hero.css';

const Hero = () => {
  return (
    <section id="home" className="hero-section d-flex align-items-center">
      <Container className="text-center my-8">
        <h1>Hello, I'm <span className="text-primary">Nama Srilatha</span></h1>
        <p className="lead">Aspiring Software Engineer | MERN Stack Developer</p>
        <a href="#projects" className="btn btn-primary mt-3">View My Work</a>
      </Container>
    </section>
  );
};

export default Hero;
